  \"2015-05-06T22:06:11.640455\",\n\t\"name\": \"high-rate-tellecommunications-for-mars-planetary-and-proximity-ranges-and-other-deep-space\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Space vehicles for deep space exploration
  rely on microwave and millimeter wave links for communication with earth stations.
  As the mission of space probes expands, the data rate to be transmitted increases,
  and effective, compact, methods of modulating the RF carrier with high-speed data
  become a critical necessity.  Passive MMIC modulation approaches introduce loss
  into the RF path and analog phase shifters in particular can exhibit significant
  shortcomings such as insertion loss variations and phase-shift range limitations.
  For more complex digital or hybrid modulation schemes, passive modulator components
  may also need elaborate calibration look-up tables to achieve desired phase and
  amplitude modulation accuracy with respect to process and temperature variations.
  Hittite has recently developed high-performance, active I/Q vector modulator MMICs
  for communication systems operating up to C-band, based on SiGe and GaAs HBT process
  technologies. As part of this program, we propose to apply similar circuit techniques
  together with more advanced device technologies to develop high-performance active
  vector modulators for both X- and Ka-band frequencies.\",\n\t\"license_title\":
